adata\":{\"license\":\"U\",\"contentType\":\"Image\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":3.210272873194221,\"y\":15.853337603165594,\"width\":95.09138381201,\"height\":15.051546391753,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>From the ancient times, chemists started using symbols to represent elements. Alchemical* symbols were used to represent some elements and some compounds until the \\\\(18^{th}\\\\) century.</p>\\n\\n<p> </p>\\n\"},\"subContentId\":\"97e8a593-e869-4d74-83a9-2c4c8ec12332\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.531393568147,\"y\":90.634441087613,\"width\":94.721796937213,\"height\":8.9224574018127,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.75em\\\"><em>*Alchemy is a type of chemistry, especially in the Middle Ages, that dealt with trying to find a way to change ordinary metals into gold and with trying to find a medicine that would cure any disease.</em></span></p>\\n\"},\"subContentId\":\"deddcaba-995a-47d6-a96a-086c7571324b\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":30.497592295345104,\"y\":3.1607591846311403,\"width\":39.99807383627608,\"height\":9.507056320567168,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3 style=\\\"text-align:center\\\"><strong>Alchemical Symbols</strong></h3>\\n\"},\"subContentId\":\"35167df0-8353-493e-9084-cc0c50fab88a\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":3.9164490861619,\"y\":5.1546391752577,\"width\":27.206266318538,\"height\":5.7731958762887,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong><span style=\\\"font-size:1.125em\\\">Dalton 1808 - 36 elements</span></strong></p>\\n\"},\"subContentId\":\"efd4727d-5a04-4b27-91e5-2714cfdeac11\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":3.763097932742151,\"y\":11.150426689661325,\"width\":94.721796937213,\"height\":40.040282175227,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>John Dalton (1766-1844) was an English meteorologist who proposed the Atomic Theory in 1803 which stated that all matter was composed of small indivisible particles termed atoms.</p>\\n\\n<p>Since the old alchemical symbols were not fit to use in Dalton's theory, he proposed a new set of standard symbols for the chemical elements.</p>\\n\\n<p>Dalton's symbols are not the ones we use today. They are circles containing distinct symbols. He used them singly to represent elements and in combination to show compounds.</p>\\n\"},\"subContentId\":\"7b926358-e157-4d7d-bc3c-6d30177b8863\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDispla
